  false,\n\t\"url\": null,\n\t\"notes\": \"The PAD (Property Address Directory) file
  contains additional geographic information at the tax lot level not found in the
  PLUTO files.  This data includes alias addresses and Building Identification Numbers
  (BINs).  It consists of two ASCII, comma delimited files: a tax lot file and an
  address file.rnrnNote To Users: A new field (ZIP Code) has been added to the bobaadrx
  (Address) file.  Please check your procedures to make sure this does not cause any
  problems.  For earlier versions, see PAD releases on the BYTES of the BIG APPLE
  archive page.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
